import {SET_WALLET_DATA} from "../actions";

const initialState = {}

const wallet = (state = initialState, action) => {
  switch (action.type) {
    case SET_WALLET_DATA:
      return ({
        ...action.data,
      })
    default:
      return state
  }
}
export default wallet;
